import * as react from 'react';
import {
  Checkbox,
  FormControlLabel,
  FormGroup,
  Grid,
  Stack,
  Card,
  CardHeader,
  CardContent,
  Container,
  Paper,
  Divider,
} from '@mui/material';

export default function AlertSettings() {
  return (
    <Container maxWidth={'md'} sx={{ flex: 1, display: 'flex' }}>
      <Card sx={{ flex: 1 }}>
        <CardHeader title={'Alert&Notifications Settings'} />
        <Divider />
        <CardContent>
          <Grid container sx={{ flex: 1 }}></Grid>
        </CardContent>
      </Card>
    </Container>
  );
}
